import React, { useEffect } from "react";
import { useSelector, useDispatch } from "react-redux";
import { getArticles } from "../redux/actions/articles";
import ArticaleCard from "./ArticleCard";

const Articaleslist = () => {
  useEffect(() => {
    const dispatch = useDispatch();
    dispatch(getArticles());
  }, []);
  const articles = useSelector((state) => state.articales);

  return (
    <div>
      {/* {articales && articales.map((el) => <ArticaleCard el={el} />)} */}
      {articles &&
        articles.map((el) => (
          <div key={el.id}>
            <div>
              {console.log("test")}
              <div>{el.title}</div>
              <div>{el.description}</div>
              <div>{el.published}</div>
            </div>
          </div>
        ))}
      <div>{console.log("test1")}</div>
    </div>
  );
};

export default Articaleslist;
